import Vue from "vue";
import VueRouter from "vue-router";
import UsersDashboard from "../Users-Frontend/Components/UsersDashboard.vue";
import RolesDashboard from "../Users-Frontend/Components/RolesDashboard.vue";

import store from "@/store";

Vue.use(VueRouter);

const routes = [
  {
    path: "/Users",
    component: UsersDashboard,
    beforeEnter: () => {
      const kunda = store.getters.isUserLogged;
      console.log(kunda);
    },
  },
  {
    path: "/Roles",
    component: RolesDashboard,
    beforeEnter: () => {
      const kunda = store.getters.isUserLogged;
      console.log(kunda);
    },
  },
];

const router = new VueRouter({
  routes,
});

export default router;
